text:
@realronniemagro we appreciate your vulnerability and we're super grateful for your story. we're here for you in any way possible as you continue down your journey. stay encouraged and know that your story matters. it's unique to where you once were and encourages those around you as you're a huge influencer. 
_____
"i decided to go to treatment because i wanted to be a better person, a better father for my daughter," the 33-year-old reality star told us weekly. "eventually, all the bad decisions i was making were going to lead me to places that i didn't want to be. i wanted to be led to the place that i am now -- that's happy, healthy and the best role model for my daughter." @realronniemagro

